import React, { Component } from "react";
import "../App.css";
import Main from "./main";

class testcomp extends Component {
  render() {
    let people = [
      { name: "Adil", age: 17 },
      { name: "Danil", age: 18 },
    ]
    const example = people.map(person => <Main name = {person.name} age = {person.age}></Main>)
    return;
    <div>
      {example}
    </div>;
  }
}

export default testcomp;
